import React, {useState} from 'react';
import './App.css';
import {SuperCounter} from "./SuperCounter";
import {MaxMInValue} from "./MaxMInValue";



function App() {


    const [value,SETValue]=useState(0)
    const [disable,SetDisable]=useState(5)

    const Inc =()=> {
        SETValue(prevState => prevState + 1)
    }

    const Reset =()=> {
        SETValue(0)
    }

    const MaxValue =(e:number)=> {
        SETValue(e)
    }

    const MinValue =(e:number)=> {
        SetDisable(e)
    }
    return (
        <div className="App">
       <SuperCounter inc={Inc} value={value} reset={Reset} disable={disable}/>
            <MaxMInValue maxValue={MaxValue}  minValue={MinValue}/>

        </div>
    );
}

export default App;
